import React from "react";
import { Link } from "react-router-dom";

const Home = () => {
  return (
    <div className="w-full h-full bg-gradient-to-br from-[#0A0F30] via-[#1B1F38] to-[#292E57] min-h-screen flex flex-col justify-start items-center pt-12 relative">
      
      {/* Background Image */}
      <div className="absolute inset-0 bg-[url('https://files.oaiusercontent.com/file-41HweKCX1YfK9kCC4tDHLS?se=2025-03-13T06%3A58%3A09Z&sp=r&sv=2024-08-04&sr=b&rscc=max-age%3D604800%2C%20immutable%2C%20private&rscd=attachment%3B%20filename%3D250b33ee-47fa-41fb-8ae0-76d58d203fee.webp&sig=kN6SU5sx2zaAc9sElvyCrwpdWi4t4O5IVfP6cuxy4q0%3D')] bg-cover bg-center brightness-75"></div>

      {/* Overlay Content */}
      <div className="relative text-center text-white px-6 max-w-2xl z-10 mt-24 justify-center">
        <h1 className="text-3xl md:text-5xl font-bold drop-shadow-lg animate-fade-in">
          <span className="text-[#46EFFF]">Elevate</span> Your Fitness with <span className="text-[#A084E8]">GYM PRO</span>
        </h1>
        <p className="mt-4 text-lg font-semibold md:text-xl opacity-90 animate-fade-in delay-200 text-gray-300">
          Power, Performance, and Progress â€“ Take control of your fitness journey today!
        </p>
        
        <div className="mt-6">
          <Link 
            to={'/userLogin'} 
            className="px-8 py-3 bg-gradient-to-r from-[#3A86FF] to-[#8338EC] text-white font-semibold rounded-lg shadow-lg hover:shadow-[0px_0px_15px_#46EFFF] transition duration-300 animate-fade-in delay-400"
          >
            Get Started
          </Link>
        </div>
      </div>
    </div>
  );
};

export default Home;
